o-level-number-position:left;\n	text-indent:-18.0pt;\n	mso-ansi-font-size:10.0pt;\n	font-family:Wingdings;}\n\n--&gt;\n&lt;/style&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 12pt; line-height: 15.399999618530273px; text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 36pt; font-family: &amp;quot;Source Sans Pro&amp;quot;, sans-serif; color: rgb(28, 28, 27); letter-spacing: -0.6pt;&quot;&gt;Pol&iacute;tica de privacidad y aviso legal.&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 12pt; line-height: 15.399999618530273px; text-align: justify;&quot;&gt;&lt;span style=&quot;color: rgb(28, 28, 27); font-family: &amp;quot;Times New Roman&amp;quot;, serif; font-size: 30pt;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 12pt; line-height: 15.399999618530273px; text-align: justify;&quot;&gt;&lt;span style=&quot;color: rgb(28, 28, 27); font-family: &amp;quot;Times New Roman&amp;quot;, serif; font-size: 30pt;&quot;&gt;Pol&iacute;tica de privacidad&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;b style=&quot;font-size: 11pt;&quot;&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;Informaci&oacute;n b&aacute;sica sobre protecci&oacute;n de datos&lt;/span&gt;&lt;/b&gt;&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;A continuaci&oacute;n, le informamos sobre la pol&iacute;tica de protecci&oacute;n de datos de&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;Iglesia Tabern&aacute;culo de Vida-Madrid&lt;span style=&quot;color: rgb(53, 53, 53);&quot;&gt;.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;Responsable del tratamiento&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;Los datos de car&aacute;cter personal que se pudieran recabar directamente del interesado ser&aacute;n tratados de forma confidencial y quedar&aacute;n incorporados a la correspondiente actividad de tratamiento titularidad de&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;Iglesia Tabern&aacute;culo de Vida-Madrid.&lt;span style=&quot;color: rgb(53, 53, 53);&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;Finalidad&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;La finalidad del tratamiento de los datos se detalla en los formularios de contacto a trav&eacute;s de los cuales se recaban los datos personales.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;La comunicaci&oacute;n de sus datos b&aacute;sicos de contacto es imprescindible para que le contactemos y respondamos a su solicitud o consulta.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;Legitimaci&oacute;n o base jur&iacute;dica&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;&Uacute;nicamente trataremos sus datos personales en base al consentimiento prestado por usted mediante una declaraci&oacute;n o una clara acci&oacute;n afirmativa.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;Conservaci&oacute;n de datos&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;Los datos personales proporcionados se conservar&aacute;n durante el tiempo necesario para cumplir con la finalidad para la que se recaban y para determinar las posibles responsabilidades que se pudieran derivar de la finalidad.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;Cesi&oacute;n de datos&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;Con car&aacute;cter general no se comunicar&aacute;n los datos personales a terceros, salvo obligaci&oacute;n legal, entre las que pueden estar las comunicaciones a los Jueces y Tribunales.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;Derechos de los interesados&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;Puede retirar el consentimiento prestado en cualquier momento y puede ejercer sus derechos de acceso, rectificaci&oacute;n, supresi&oacute;n y portabilidad de sus datos, de limitaci&oacute;n y oposici&oacute;n a su tratamiento, ante el responsable del tratamiento, enviando un correo electr&oacute;nico a&amp;nbsp;&lt;/span&gt;&lt;a href=&quot;mailto:info@tdvmadrid.com&quot;&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;info@tdvmadrid.com&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;Delegado de protecci&oacute;n de datos&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;El delegado de protecci&oacute;n de datos es la persona f&iacute;sica o jur&iacute;dica que asesora al responsable o al encargado del tratamiento acerca de las obligaciones del RGPD y dem&aacute;s normativa aplicable en protecci&oacute;n de datos, y supervisa el cumplimiento de aqu&eacute;lla y de las pol&iacute;ticas del responsable o encargado de tratamiento, adem&aacute;s de actuar como punto de contacto de la AEPD para cuestiones relativas al tratamiento de datos personales.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;Nuestro delegado de protecci&oacute;n de datos es Federaci&oacute;n de Entidades Religiosas Evang&eacute;licas de Espa&ntilde;a, y puede contactarle para conocer m&aacute;s acerca del tratamiento de sus datos personales por esta entidad, en su domicilio en Calle Pablo Serrano, 9 posterior, de Madrid (28043), o en la direcci&oacute;n de correo electr&oacute;nico&amp;nbsp;&lt;/span&gt;&lt;a href=&quot;mailto:protecciondatos@ferede.org&quot;&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;protecciondatos@ferede.org&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 15pt; line-height: 15.399999618530273px; text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 30pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(28, 28, 27);&quot;&gt;Aviso legal&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;El titular del presente portal es Iglesia Tabern&aacute;culo de Vida-Madrid inscrita en el Registro de Entidades Religiosas con el n&uacute;mero 024738, con NIF R2802542-G, domicilio en la calle Roble, n&ordm; 22-bajo, de Madrid, c&oacute;digo postal 28020.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;Propiedad intelectual e industrial&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;El dise&ntilde;o del portal y sus c&oacute;digos fuente, as&iacute; como los logos, marcas y dem&aacute;s signos distintivos que aparecen en el mismo pertenecen a&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;Iglesia Tabern&aacute;culo de Vida-Madrid&amp;nbsp;&lt;span style=&quot;color: rgb(53, 53, 53);&quot;&gt;y est&aacute;n protegidos por los correspondientes derechos de propiedad intelectual e industrial.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;Responsabilidad de los contenidos&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif; color: rgb(53, 53, 53);&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;Iglesia Tabern&aacute;culo de Vida-Madrid&amp;nbsp;&lt;span style=&quot;color: rgb(53, 53, 53);&quot;&gt;no se hace responsable de la legalidad de otros sitios web de terceros desde los que pueda accederse al portal. Tampoco respondemos por la legalidad de otros sitios web de terceros, que pudieran estar vinculados o enlazados desde este portal.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;Iglesia Tabern&aacute;culo de Vida-Madrid&amp;nbsp;&lt;span style=&quot;color: rgb(53, 53, 53);&quot;&gt;se reserva el derecho a realizar cambios en el sitio web sin previo aviso, al objeto de mantener actualizada su informaci&oacute;n, a&ntilde;adiendo, modificando, corrigiendo o eliminando&amp;nbsp;los contenidos publicados o el dise&ntilde;o del portal.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom: 11.25pt; line-height: 15.95pt; text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 13.5pt; font-family: &amp;quot;Times New Roman&amp;quot;, serif;&quot;&gt;Iglesi